import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Login from "./components/auth/login";
import Register from "./components/auth/register";
import CarPicker from "./components/car/carPicker";
import DatePicker from "./components/date/datePicker";
import PlotPicker from "./components/plot/plotPicker";

function Home() {
  return (
    <div>
      <h1>Üdvözlünk a főoldalon!</h1>
      <nav>
        <ul>
          <li><Link to="/login">Login</Link></li>
          <li><Link to="/register">Register</Link></li>
          <li><Link to="/carPicker">Car Picker</Link></li>
          <li><Link to="/datePicker">Date Picker</Link></li>
          <li><Link to="/plotPicker">Plot Picker</Link></li>
        </ul>
      </nav>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/carPicker" element={<CarPicker />} />
        <Route path="/datePicker" element={<DatePicker />} />
        <Route path="/plotPicker" element={<PlotPicker />} />
      </Routes>
    </Router>
  );
}

export default App;
